import './App.css';
import { NavBar } from './components/navBar';
import { BrowserRouter, Routes, Route } from 'react-router-dom'
import { MainPage } from './Pages/mainPage/mainPage';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <NavBar />
        <Routes>
          <Route path='/' element={<MainPage />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
